function PortfolioItem ({ project,URI }) {

function cardFunctionalities() {
    const portfolioCard = document.querySelector('.portfolio-card')
    portfolioCard.addEventListener('mouseenter', event => {
        portfolioCard.querySelector('h3').classList.add('roll')
    })
    portfolioCard.addEventListener('mouseleave', event => {
        portfolioCard.querySelector('h3').classList.remove('roll')
    })
}

cardFunctionalities()

    return (
        <div className="col-md-4">
           <div className="portfolio-card m-4 p-3" style={{backgroundImage:`url(${URI + project.Image.formats.small.url})`}}>
           <h3>{project.Title}</h3>
           </div>
        </div>
    )
}

export default PortfolioItem
